import React from "react"; 
import "./Categorias.css";

const Categorias = () => {
  return (
    <div className="categorias-container">
      <div className="left-side">
        <h2>CATEGORIAS REGISTRADAS</h2>
        <div className="category-list">
          <img src="/path/to/trash-icon.png" alt="Eliminar" className="trash-icon" />
        </div>
      </div>
      <div className="right-side">
        <div className="input-group">
          <label htmlFor="category-name">NOMBRE DE CATEGORIA</label>
          <input type="text" id="category-name" className="input-field" />
        </div>
        <div className="input-group">
          <label htmlFor="category-description">DESCRIPCION</label>
          <textarea id="category-description" className="textarea-field"></textarea>
        </div>
        <button className="register-button">REGISTRAR NUEVA CATEGORIA</button>
        <button className="edit-button">CONFIRMAR EDICION</button>
      </div>
    </div>
  );
};

export default Categorias;
